import {Fragment} from 'react'
import { useParams } from 'react-router-dom';

const QuoteDetail = () => {
    const params = useParams();
    return (
        <Fragment>
            <h1>Quote Detail</h1>
            <span>{params.quoteId}</span>
        </Fragment>

    )
}
export default QuoteDetail;
